import NavScrollExample from './components/navBar';
import Footer from './components/footer';
import CarouselSec  from './components/carsul';
import ImageGallery from "./components/opinions";
import Cards from './components/cards';
import AboutUs from './components/about us'
import { BootstrapIcon } from 'bootstrap-icons-react';
import { whatsapp } from 'bootstrap-icons-react/icons';
import { Icon } from 'react-bootstrap-icons';




function App() {
  return (
    <nav>
    <Icon icon={whatsapp} size={64} color="green" style={{cursor: "pointer"}} onClick={() => window.open("https://wa.me/1234567890", "_blank")}/>
    <BootstrapIcon icon={whatsapp} size="2em" color="white" style={{cursor: "pointer"}} onClick={() => window.open("https://wa.me/1234567890", "_blank")}/>

      <NavScrollExample></NavScrollExample>
      <CarouselSec></CarouselSec>
      <AboutUs></AboutUs>
      <Cards></Cards>
      <ImageGallery></ImageGallery>

      <Footer></Footer>
    </nav>
  )
}

export default App;
